import { Button } from "react-bootstrap";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import logo from "../../assets/logos/logo.png";

function NavigationBar() {
  return (
    <Navbar
      collapseOnSelect
      fixed
      expand="lg"
      bg="transparent"
      variant="transparent">
      <Container>
        <Navbar.Brand className="mx-0" href="#home">
          <img
            src={logo}
            width="50"
            height="50"
            className="d-inline-block align-top"
            alt="Mudex logo"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav
            className="me-auto "
            style={{
              fontSize: "20px",
              fontWeight: "bold",
              fontFamily: "sans-serif",
            }}>
            {Menu.map((item, index) => {
              <Nav.Link className="text-light mx-3" href={item.path}>
                {item.title}
              </Nav.Link>;
            })}
            <Nav.Link className="text-light mx-3" href="#features">
              Exchange
            </Nav.Link>
            <Nav.Link className="text-light mx-3" href="#pricing">
              Songs
            </Nav.Link>

            <Nav.Link className="text-light mx-3" href="#pricing">
              Pool
            </Nav.Link>

            <Nav.Link className="text-light" href="#pricing">
              <input
                type="text"
                placeholder="Search Songs"
                style={{
                  marginLeft: "120px",
                  borderRadius: "20px",
                  height: "40px",
                  width: "300px",
                  //glassmorphism with black background

                  color: "white",

                  background: "rgba(5, 24, 57, 255)",

                  border: "1px solid rgba(255, 255, 255, 0.2)",
                  boxShadow: "0 8px 32px 0 rgba(31, 38, 135, 0.37)",
                  padding: "10px",
                  textAlign: "center",

                  //glassmorphism
                }}
              />
            </Nav.Link>
          </Nav>
          <Nav>
            <Button
              variant="primary"
              size="sm"
              style={{ borderRadius: "20px" }}>
              Connect Wallet
            </Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavigationBar;
